preprocessing:
  cwt:
    sample_rate: 4096
    target_height: 64
    use_analytic: false
    fmin: 20.0
    fmax: 512.0
    n_scales: 64
    wavelet: morl
    k_pad: 10.0
    k_coi: 6.0
model:
  model_type: cwt_lstm
  input_height: 64
  input_width: 131072
  latent_dim: 32
  lstm_hidden: 64
  dropout: 0.1
  training:
    batch_size: 8
    num_epochs: 50
    learning_rate: 0.001
    optimizer: adam
    scheduler: reduce_on_plateau
    early_stopping_patience: 3
    validation_split: 0.2
    loss_function: mse
    augmentation:
      enabled: false
      noise_level: 0.01
      time_shift: 0.1
  save:
    model_dir: models/
    checkpoint_dir: models/checkpoints/
    best_model_name: best_cwt_lstm_model.pth
    final_model_name: final_cwt_lstm_model.pth
    save_every_n_epochs: 10
  anomaly_detection:
    threshold_percentile: 95.0
    reconstruction_error_threshold: null
    min_anomaly_score: 0.5
pipeline:
  run_management:
    create_unique_dirs: true
    run_metadata_file: run_metadata.json
    include_git_hash: true
    include_timestamp: true
  data_flow:
    use_preprocessed_data: true
    preprocessed_data_dir: data/processed/
    train_on_noise_only: true
    test_on_all_data: true
    train_test_split:
      train_noise_only: true
      test_noise_and_signals: true
      noise_ratio: 5.0
  output:
    results_dir: results/
    plots_dir: results/plots/
    logs_dir: results/logs/
    reports_dir: results/reports/
